import styled from 'styled-components'

import {NavLink} from 'react-router-dom'


export const NavigStyled = styled(NavLink)`

    display: flex;
    flex-direction: column;
    align-items: center;
    width:20px;
    white-space

    &:hover{
        transform: scale(1.25);
        color: black;
        text-decoration: none;
    }

    &:visited{
        color: black;
        text-decoration: none;
    }

`
